// src/components/WishlistDrawer.jsx
import React, { useEffect } from "react";
import { X, Heart, Trash2 } from "lucide-react";
import { useCart } from "../context/CartContext"; // pakai context lama (items, addItem, clear, optional remove)

export default function WishlistDrawer({ open, onClose }) {
  const { items, clear, remove } = useCart();

  // tutup dengan ESC
  useEffect(() => {
    const onKey = (e) => e.key === "Escape" && onClose?.();
    if (open) window.addEventListener("keydown", onKey);
    return () => window.removeEventListener("keydown", onKey);
  }, [open, onClose]);

  const handleRemove = (id) => {
    if (typeof remove === "function") remove(id); // kalau context ada remove
  };

  return (
    <>
      {/* Overlay */}
      <div
        onClick={onClose}
        className={
          "fixed inset-0 z-50 bg-black/40 backdrop-blur-[1px] transition-opacity " +
          (open ? "opacity-100 visible" : "opacity-0 invisible")
        }
        aria-hidden={!open}
      />

      {/* Panel */}
      <aside
        className={
          "fixed right-0 top-0 bottom-0 z-50 w-[360px] max-w-[92vw] bg-white dark:bg-slate-900 border-l border-slate-200 dark:border-slate-800 shadow-xl " +
          "transition-transform duration-300 will-change-transform " +
          (open ? "translate-x-0" : "translate-x-full")
        }
        role="dialog"
        aria-modal="true"
        aria-label="Wishlist"
      >
        <header className="h-16 flex items-center justify-between px-4 border-b border-slate-200 dark:border-slate-800">
          <div className="flex items-center gap-2">
            <Heart size={18} className="text-sky-600" />
            <h2 className="font-semibold">Wishlist</h2>
          </div>
          <button
            onClick={onClose}
            className="p-2 rounded-xl hover:bg-slate-100 dark:hover:bg-slate-800"
            aria-label="Close wishlist"
          >
            <X size={18} />
          </button>
        </header>

        <div className="p-4 h-[calc(100%-8rem)] overflow-y-auto">
          {items.length === 0 ? (
            <p className="text-sm text-slate-500">Wishlist kosong.</p>
          ) : (
            <ul className="space-y-3">
              {items.map((it) => (
                <li
                  key={it.id + String(it.pax ?? "")}
                  className="border border-slate-200 dark:border-slate-800 rounded-2xl p-3 flex items-start justify-between gap-3"
                >
                  <div className="min-w-0">
                    <p className="font-medium truncate">{it.title}</p>
                    <p className="text-xs text-slate-500">
                      Qty: {it.qty || 1}
                      {it.pax ? <> • Pax: {it.pax}</> : null}
                    </p>
                    {typeof it.price === "number" && (
                      <p className="text-sm text-sky-600 mt-0.5">
                        {(it.price || 0).toLocaleString("id-ID")}
                      </p>
                    )}
                  </div>
                  <button
                    onClick={() => handleRemove(it.id)}
                    className="p-2 rounded-xl hover:bg-slate-100 dark:hover:bg-slate-800"
                    title="Hapus dari wishlist"
                    aria-label="Hapus item"
                  >
                    <Trash2 size={16} />
                  </button>
                </li>
              ))}
            </ul>
          )}
        </div>

        <footer className="p-4 border-t border-slate-200 dark:border-slate-800">
          <div className="flex items-center justify-between">
            <button
              onClick={clear}
              className="btn btn-outline"
              disabled={items.length === 0}
              title="Kosongkan wishlist"
            >
              Kosongkan
            </button>
            <button
              onClick={onClose}
              className="btn btn-primary"
              disabled={items.length === 0}
              title="Lanjut jelajah"
            >
              Lanjutkan
            </button>
          </div>
        </footer>
      </aside>
    </>
  );
}
